import React, { Component } from "react";
 
class Favorite extends Component {
  render() {
    return (
      <div class="wrapper">
        <div><b>(A) Shrimp w. Head (1lb) & Snow Crab Legs (1lb)</b><br>
                Comes with 2 Corn & 2 Potatoes. Seasonings: Cajun,</br><br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$39.50</b></br></div>
        <div><b>(B) Shrimp w. Head (1lb) & Snow Crab Legs (1lb)</b><br>
                Comes with 2 Corn & 2 Potatoes. Seasonings: Cajun,</br><br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$43.50</b></br></div>
        <div><b>(C) Shrimp w. Head (1lb) & Snow Crab Legs (1lb)</b><br>
                Comes with 2 Corn & 2 Potatoes. Seasonings: Cajun,</br><br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$28.50</b></br></div>          
        <div><b>(D) Shrimp w. Head (1lb) & Snow Crab Legs (1lb)</b><br>
                Comes with 2 Corn & 2 Potatoes. Seasonings: Cajun,</br><br>
                Lemon Pepper, Garlic Butter, Creole or the Twisted Sauce</br>
                <br><b>$39.50</b></br></div>     
      </div>
    );
  }
}
 
export default Favorite;
